import React from 'react'
import Jumbotron from 'react-bootstrap/Jumbotron'
import Container from 'react-bootstrap/Container';
import headerImg from '../assets/35mm.jpg'

function Header(){
    return(
        <Jumbotron fluid>
            <Container>
                <Image src={headerImg}/>
            </Container>
        </Jumbotron>
    );
}

export default Header;
